}

class ApplicantList extends React.Component {
	constructor(props){
		this.state = {names: ["Name One"]}; //array of applicant names
		//this.setState({names: names()});
	}
  render(){
    return(
      <div id="mainListDiv">
        <p> Showing results in my app </p>
        this.state.names.map(n => <p>{n}</p>)
      </div>
    );
  }
}

